  {
    name: "Oracle Corporation",
    symbol: "ORCL",
    lastPrice: 44.65,
    change: -0.300000000000004,
    high: 45.09,
    low: 44.575,
    open: 44.91
  },
  {
    name: "Intel Corporation",
    symbol: "INTL",
    lastPrice: 36.16,
    change: -0.370000000000005,
    high: 36.78,
    low: 36.125,
    open: 36.58
  }
];

class App extends Component {
  render() {
    const stocks = stocklist.map((stock, index) => (
      <Stocks name={stock.name} key={index} />
    ));

    return (
      <div>
        <nav>
          {/* create nav bar here*/}

          <ul>
            {/* <li><Link to="/home">Home</Link></li>
            <li><Link to ="/about">About</Link></li>
            <li><Link to ="/stocks">Stocks</Link></li> */}
          </ul>
        </nav>
        <main>
          {/* create the routes; they will not appear on the page */}

          {/* <Route path="/home" component = {Home}/>
      <Route path="/about" component = {About} />
      <Route path="/stocks" component = {Stocks} /> */}

          <Stocks name={stocks.name} />
        </main>
      </div>
    );
  }
}
export default App;
